import { GoogleGenAI } from "@google/genai";

const SYSTEM_INSTRUCTION = `
Voc√™ √© um Consultor Imobili√°rio especialista no mercado de Portugal (Lisboa, Porto, Algarve, etc).
Seu objetivo √© ajudar o usu√°rio que quer comprar ou vender casa e est√° perdido.
Regras de conduta:
1. Seja profissional, acolhedor e direto.
2. Explique termos como IMT, Imposto de Selo, IMI, Mais-valias, CPCV e Escritura.
3. Se o usu√°rio quiser comprar, fale sobre localiza√ß√£o e financiamento.
4. Se quiser vender, fale sobre avalia√ß√£o e prepara√ß√£o do im√≥vel.
5. Mencione os benef√≠cios de ter um √∫nico consultor (fidelidade, foco, seguran√ßa).
6. Use portugu√™s de Portugal (ex: "casa" em vez de "resid√™ncia" quando apropriado, use "apartamento", "moradia").
7. Mantenha as respostas curtas e √∫teis.
`;

export const getGeminiResponse = async (userPrompt: string) => {
  try {
    const ai = new GoogleGenAI({ apiKey: process.env.API_KEY });
    const response = await ai.models.generateContent({
      model: 'gemini-3-flash-preview',
      contents: userPrompt,
      config: {
        systemInstruction: SYSTEM_INSTRUCTION,
        temperature: 0.7,
      },
    });
    return response.text;
  } catch (error) {
    console.error("Gemini API Error:", error);
    return "Desculpe, tive um problema ao processar o seu pedido. Por favor, tente novamente ou contacte um de nossos consultores diretamente.";
  }
};

